CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_productos_insert`(out p_prod_id int(12), in p_prod_nombre varchar(150), in p_prod_precio double(18,5), in p_cat_id int(12) , in p_marca_id int(12), in p_prod_modelo varchar(100), in p_prod_stock int(12), in p_prod_ficha_teccnica varchar(2000) )
BEGIN
		SET @id_producto= (SELECT IFNULL(max(prod_id),0) +1 from producto );
		insert into producto (prod_id,prod_nombre,prod_precio,cat_id, marca_id,prod_modelo,
        prod_stock,prod_ficha_teccnica)
        values(@id_producto,p_prod_nombre,p_prod_precio,p_cat_id, p_marca_id,p_prod_modelo,
        p_prod_stock,p_prod_ficha_teccnica);
        
        set p_prod_id =  @id_producto;
END ;;
